import React from 'react';
import logo from './logo.svg';
import iphone from './ressources/iphonex.png';
import arrowLeft from './ressources/arrow-left-circle.svg';
import arrowRight from './ressources/arrow-right-circle.svg';

import './App.css';
import Navbar from './Navbar';



export default class ProductPage extends React.Component{

    constructor(props){
        super(props);
        this.state = {
            photos: [iphone,logo],
            indexPhoto: 0
        }
    }

    onclick(type){
        this.setState(prevState => {
           return {indexPhoto: type == 'add' ? prevState.count + 1: prevState.count - 1}
        });
    }

    render(){
        return(
            <div>
                <div><Navbar/></div>
                <div id="frame">
                    <div class="border border-2 rounded-1" id="photo-frame">
                        <div>
                            <img src={arrowLeft} id="arrow-circle" onClick={this.onclick.bind(this, 'prev')}></img>
                            <img src={this.state.photos[this.state.indexPhoto]} id="photo"></img>
                            <img src={arrowRight} id="arrow-circle" onClick={this.onclick.bind(this, 'next')}></img>
                        </div>
                        <div>
                            <p>A very great mobile phone.</p>
                        </div>
                    </div>
                    <div class="border border-2 rounded-1" id="photo-frame2"></div>
                </div>
            </div>
        )
    }
}
